import React from 'react';
import { Container, Card, CardBody, CardTitle, CardSubtitle, CardText, Col, Input, Form, InputGroup, InputGroupAddon, Button, Row, Modal, ModalBody, ModalHeader, ModalFooter } from 'reactstrap';
import '../App.css';

function PlayerCard(props) {
    return (
        <Col xs="4">
            <Card>
                <CardBody>
                    <CardTitle>Card title</CardTitle>
                    <CardSubtitle>Card subtitle</CardSubtitle>
                    <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
                    <Button>Button</Button>
                </CardBody>
            </Card>
        </Col>
    )
}

export default function BattleCounter(props) {
    return (
        <Container>
            <Row>
                <PlayerCard />
                <PlayerCard />
                <PlayerCard />
                <PlayerCard />
                <PlayerCard />
                <PlayerCard />
                <h1>egeger</h1>
            </Row>
        </Container>
    )
}
